//list of all actions of Users component

export const ADD = 'users:addUsersAction';
export const REMOVE = 'users:removeUsersAction';


export const addUsersAction = (id) => {
    return {
        type: ADD,
        payload: {
            id: id
        }

    }
}

export const removeUsersAction = (id) => {
    return {
        type: REMOVE,
        payload: {
            id: id
        }

    }
}
